import React from 'react';
import TaskItem from './TaskItem';

const TaskList = ({ tasks = [], onEdit, onDelete, onToggle }) => {
    return (
        <ul>
            {tasks.length > 0 ? (
                tasks.map((task, index) => 
                    task && task.id ? (
                        <TaskItem
                            key={task.id}
                            task={task}
                            onEdit={onEdit}
                            onDelete={onDelete}
                            onToggle={onToggle}
                        />
                    ) : (
                        <li key={index}>Invalid task</li> // Handle invalid task case
                    )
                )
            ) : (
                <p>No tasks available</p>
            )}
        </ul>
    )
};
export default TaskList;
